character(500),pointer,dimension(:)::ptr
character(*),dimension(:) :: name
if(any(name.eq.'Interac')) then
ptr=>Interac
elseif(any(name.eq.'rk_qk')) then
ptr=>rk_qk
end if
end subroutine get_unifac_psrk_files
end module unifac_psrk_files
